    tableHeader: (props) => {
        let o = Object.keys(props[0]);
        return o.map((key)=>{
                return <th key={key}>{key.toUpperCase()}</th>
                })
    },

    renderRow:(props)=>{
        return props.keys.map((key, index)=>{
        return <td key={props[key]}>{props[key]}</td>
        })
       },

